import React, {Component} from 'react'
import ReactDom from 'react-dom'
import Layout from '../components/Layouts.js'
import TodoList from '../components/TodoList.js'

class Index extends Component{
  render(){
    return(
      <div>
        <h1>Hello Todo</h1>
        <Layout />
        <TodoList />
      </div>
    )
  }
}


export default Index
